import React from "react"
import "./css/App.css"
import { BrowserRouter as Router,Switch,Route } from "react-router-dom";
import Header from "./Header";
import Home from "./Home"
import Checkout from "./Checkout";
import Login from "./Login";
function App(){
    return (
        <Router>
            <Switch>
                <Route path="/checkout">
                    <Checkout/>
                </Route>

                <Route path="/login">
                    <Login/>
                </Route>

                <Route path="/">
                    <Header />
                    <Home />
                </Route>
            </Switch>
        </Router>
    )
}
export default App
